export const Menu = [
    {
        name: 'Home',
        href: '/'
    },
    {
        name: 'Blog',
        href: '/blog'
    },
    // {
    //     name: 'Post Test',
    //     href: '/post?slug=helloWorld'
    // }
]

export const LeftTitle = {
    title: [
        {
            name: "name",
            desc: [
                "firstName",
                "lastName"
            ]
        },
        {
            name: "dob",
            desc: [
                "age",
                "dob"
            ]
        },
        {
            name: "contact",
            desc: [
                "email",
                "facebook",
                "instagram",
                "line"
            ]
        },
        {
            name: "education",
            desc: [
                "primary",
                "secondary",
                "college"
            ]
        },
        {
            name: "skill",
            desc: [
                "primary"
            ]
        }
    ],
}
